import { createSlice } from '@reduxjs/toolkit'

export const idPanelProfileSlice = createSlice({
  name: 'idPanelProfile',
  initialState: {
    value: "info",
  },
  reducers: {
    setIdPanelProfileSlice: (state, value) => {
      state.value = value.payload
    },
    clearIdPanelProfileSlice: (state) => {
      state.value = null
    },
  },
})

export const { setIdPanelProfileSlice, clearIdPanelProfileSlice } = idPanelProfileSlice.actions

export default idPanelProfileSlice.reducer
